import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import fakeData from './fakeData.js'
import Products from './pages/Products';
import Product_detail from './pages/Products/Product_detail.js';
import Add_product from './pages/Products/Add_product.js';
import Categories from './pages/Categories';

const App = () => {
  return (
    <Router>
      <>
        <Switch>
          <Route path="/add-product">
            <Add_product data={fakeData} reLoad={Add_product} />
          </Route>
          <Route path="/products">
            <Products />
          </Route>
          <Route path="/categories">
            <Categories />
          </Route>
          <Route path="/product/:id">
            <Product_detail reLoad={Product_detail} />
          </Route>
        </Switch>
      </>
    </Router>
  );
}

export default App
